import {Link} from 'react-router-dom';
import React, {useEffect, useState} from 'react';
import { useNavigate } from "react-router-dom";

function Nav(){
    const [status, setStatus] = useState([]);
    const navigate = useNavigate();
    useEffect( () => {
        fetch('http://localhost:4000/fbstatus') 
            .then(res => {
                return res.json();
            }).catch((error) => {
                alert('error with server ask for help')
            })
            .then(data => {
                setStatus(data)
            })
    }, []);

    const handleAdd = (e) => {
        navigate('/sadmin')
    }
    const handleVolun = (e) => {
        navigate('/svolun')
    }
    const handleForm = (e) => {
        if(status[0].fbstatus === 'Out of Stock'){
            navigate('/outofstock')
        }else{
            navigate('/sclient')
        }

    }
    return(

        <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
            <div class="container">
            <Link to="/" className="navbar-brand">UOSU Foodbank</Link>

            <button class= "navbar-toggler" type="button" data-bs-toggle="dropdown" data-bs-target="#navmenu">
                <span class="navbar-toggler-icon"></span>
                <div class="dropdown navbar-collapse" id="navmenu">
                    <ul class="navbar-nav ms-auto">
                        <li class= "nav-item ">
                         <button onClick={handleAdd} class="btn" style={{color: 'white'}}>Admin Sign-in</button>
                        </li>
                        <li class= "nav-item ">
                         <button onClick={handleVolun}  class="btn" style={{color: 'white'}}>Volunteer Sign-in</button>
                        </li>
                        <li class= "nav-item">
                         <button onClick={handleForm}  class="btn" style={{color: 'white'}}>Form</button>
                        </li>
                    </ul>
                </div>
            </button>


            </div>

        </nav>
    );
}

export default Nav;
